import { useContext, useState } from "react";
import { ToastContainer } from "react-toastify";
import { Header } from "../../Components/Header";
import { UserContext } from "../../Contexts/UserContext";
import { StyledMain } from "./style";
import { ImPlus } from "react-icons/im";
import { HiTrash } from "react-icons/hi2";
import { ListTecnologies } from "../../Components/ListTecnologies";
import { CardTecnology } from "../../Components/CardsTecnologies";

export const DashboardPage = () => {
  const { user } = useContext(UserContext);

  const [techs, setTechs] = useState(user.techs);
  console.log(techs);
  return (
    <>
      <Header />
      <StyledMain>
        <section>
          <div>
            <h2>Olá, {user.name}!</h2>
            <span>{user.course_module} - Kenzie Academy</span>
          </div>
        </section>
        <section>
          <div>
            <h2>Tecnologias</h2>
            <button>
              <ImPlus />
            </button>
          </div>
          <ListTecnologies>
            {techs.lenght !== 0 &&
              techs.map((tech) => {
                return <CardTecnology />;
              })}

            <li>
              <h3></h3>
              <div>
                <span>Intermediário</span>
                <button>
                  <HiTrash />
                </button>
              </div>
            </li>
            <li>fdafda</li>
            <li>fdafda</li>
            <li>fdafda</li>
            <li>fdafda</li>
            <li>fdafda</li>
          </ListTecnologies>
        </section>
      </StyledMain>
      <ToastContainer
        position="top-right"
        autoClose={2000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="dark"
      />
    </>
  );
};
